$("[data-text-over]").mouseenter(function(){const e=$(this);e.text(e.attr("data-text-over"))}).mouseleave(function(){const e=$(this);e.text(e.attr("data-text-default"))});$(window).scroll(function(){const e=$(".btn-top");const o=56;if($(this).scrollTop()<o&&!e.hasClass("invisible"))e.addClass("invisible");else if($(this).scrollTop()>o&&e.hasClass("invisible"))e.removeClass("invisible")});